script: |
  super -f text -I q6890.spq | sort > q6890.out

inputs:
  - name: q6890.spq
    data: |
      SELECT ALL - col0 + tab0.col0 FROM tab0 (FORMAT parquet) WHERE NOT ( NULL ) NOT BETWEEN - col2 AND - col1 * + col1 + col0 * col0 / - col0;
  - name: tab0

outputs:
  - name: q6890.out
    data: |
